class Problem {
    // Input to this function is a string represented multiple groups for nested parentheses separated by spaces.
    // For each of the group, output the deepest level of nesting of parentheses.
    // E.g. (()()) has maximum two levels of nesting while ((())) has three.
    // >>> parseNestedParens(("(()()) ((())) () ((())()())"))
    // (new ArrayList<Long>(Arrays.asList((long)2l, (long)3l, (long)1l, (long)3l)))
    public static ArrayList<Long> parseNestedParens(String paren_string) {
        ArrayList<Long> max_levels = new ArrayList<Long>();
        String[] paren_groups = paren_string.split(" ");
        for (String paren_group : paren_groups) {
            Stack<Character> paren_stack = new Stack<Character>();
            long max_level = 0;
            for (char c : paren_group.toCharArray()) {
                if (c == '(') {
                    paren_stack.push(c);
                    max_level = Math.max(max_level, paren_stack.size());
                } else if (c == ')') {
                    if (paren_stack.isEmpty()) {
                        throw new IllegalArgumentException("Unbalanced parentheses");
                    }
                    paren_stack.pop();
                } else {
                    throw new IllegalArgumentException("Invalid character");
                }
            }
            if (!paren_stack.isEmpty()) {
                throw new IllegalArgumentException("Unbalanced parentheses");
            }
            max_levels.add(max_level);
        }
        return max_levels;

