    // (true)
    // >>> pairsSumToZero((new ArrayList<Long>(Arrays.asList((long)1l))))
    // (false)
    public static boolean pairsSumToZero(ArrayList<Long> l) {
        // Create a set of the array list to remove duplicates.
        Set<Long> s = new HashSet<Long>(l);
        // Iterate over the set.
        for (Long i : s) {
            // If the negative of the current element is in the set, return true.
            if (s.contains(-i)) {
                return true;
            }
        }
        // If no pair sums to zero, return false.
        return false;

