        int lst1Total = lst1.stream().mapToInt(String::length).sum();
        int lst2Total = lst2.stream().mapToInt(String::length).sum();
        if (lst1Total < lst2Total) {
            return lst1;
        } else if (lst1Total > lst2Total) {
            return lst2;
        } else {
            return lst1;
