        if (k <= 0) {
            return result;
        }
        PriorityQueue<Long> maxHeap = new PriorityQueue<Long>(Comparator.reverseOrder());
        for (Long num : arr) {
            maxHeap.add(num);
            if (maxHeap.size() > k) {
                maxHeap.poll();
            }
        }
        while (!maxHeap.isEmpty()) {
            result.add(maxHeap.poll());
        }
        Collections.reverse(result);
        return result;

