        for (int i = 0; i < operand.size(); i++) {
            stack.push(operand.get(i));
            if (i < op.size()) {
                long b = stack.pop();
                long a = stack.pop();
                switch (op.get(i)) {
                    case "+":
                        stack.push(a + b);
                        break;
                    case "-":
                        stack.push(a - b);
                        break;
                    case "*":
                        stack.push(a * b);
                        break;
                    case "//":
                        stack.push(a / b);
                        break;
                    case "**":
                        stack.push((long) Math.pow(a, b));
                        break;
                }
            }
        }
        return stack.pop();

